const dashspeed = 500;

class Player {
    constructor(positionX, positionY, targetX, targetY) {
        this.ELEMENT = document.querySelector("#player");
        this.SPRITE_ELEMENT = document.querySelector("#spritePlayer");

        this.width = 4; // in %
        this.height = 4 * (16/9);

        this.HALF_OFFSET_WIDTH = 0;

        this.position = new Point(positionX, positionY);
        this.direction = 3;
        this.target = new Point(targetX, targetY);
        
        this.health = 100;
        this.moveSpeed = 300;
        this.attackRange = 400;

        this.movementPath = [];

        this.isMovingFreely = false;
        this.isMovingInGrid = false;
        this.isTargeting = false;
        this.targetID = -1;
        this.isDashing = false;
        this.isInRange = false;
        this.canDamage = true;
    }
}

class Enemy{
    constructor(id, positionX, positionY, health){
        this.id = id;
        this.ELEMENT = document.querySelector("#enemy" + id);
        this.HEALTH_ELEMENT = this.ELEMENT.querySelector(".health");

        this.width = 5; // in %
        this.height = 5 * (16/9);

        this.HALF_OFFSET_WIDTH = 0;

        this.position = new Point(positionX, positionY);
        this.target = new Point(0, 0);

        this.movementPath = [];

        this.health = health;
        this.moveSpeed = 80;
        this.attackRange = 50;

        this.isMovingFreely = false;
        this.isMovingInGrid = false;
        this.isInRange = false;
        this.canDamage = false;
    }
}

class Projectile{
    constructor(positionX, positionY, targetX, targetY) {
        this.ELEMENT = document.querySelector("#projectile");

        this.width = 3; // in %
        this.height = 3;

        this.position = new Point(positionX, positionY);
        this.target = new Point(targetX, targetY);

        this.moveSpeed = 800;
    }
}

class Point {
    constructor(x, y) {
      this.x = x;
      this.y = y;
    }
}

