var enviromentGraph = new Graph(enviromentMap, { diagonal: true });

(function onInit(){
    setAspectRatio();
    let arena = document.getElementById('arena');

    player = new Player(arena.offsetWidth/2, arena.offsetHeight/2, 0, 0);
    player.moveSpeed = baseMoveSpeed;
    player.SPRITE_ELEMENT.classList.add("idle3");
    
    enemiesSpawnPoints = [
        {x: 0, y:0},
        {x: arena.offsetWidth/2,y: 0},
        {x: arena.offsetWidth - 5, y:0},
        {x: 0, y:arena.offsetHeight - 5},
        {x: arena.offsetWidth/2, y:arena.offsetHeight - 5},
        {x: arena.offsetWidth - 5, y:arena.offsetHeight - 5 },
    ]

    let enemy0 = new Enemy(0, enemiesSpawnPoints[0].x, enemiesSpawnPoints[0].y, 100);
    let enemy1 = new Enemy(1, enemiesSpawnPoints[1].x, enemiesSpawnPoints[1].y, 100);
    let enemy2 = new Enemy(2, enemiesSpawnPoints[2].x, enemiesSpawnPoints[2].y, 100);
    let enemy3 = new Enemy(3, enemiesSpawnPoints[3].x, enemiesSpawnPoints[3].y, 100);
    let enemy4 = new Enemy(4, enemiesSpawnPoints[4].x, enemiesSpawnPoints[4].y, 100);
    let enemy5 = new Enemy(5, enemiesSpawnPoints[5].x, enemiesSpawnPoints[5].y, 100);

    enemies.push(enemy0);
    enemies.push(enemy1);
    enemies.push(enemy2);
    enemies.push(enemy3);
    enemies.push(enemy4);
    enemies.push(enemy5);

    projectile = new Projectile(0, 0, 0, 0);

    setAspectRatio();
    setElementsSize();
    setElementsPosition();
    initEvents();

    setInterval(()=>createEnemyPath(0), 1000);
    // setInterval(()=>createEnemyPath(1), 1000);
    // setInterval(()=>createEnemyPath(2), 1000);
    // setInterval(()=>createEnemyPath(3), 1000);
    // setInterval(()=>createEnemyPath(4), 1000);
    // setInterval(()=>createEnemyPath(5), 1000);
})();

function initEvents(){
	window.addEventListener("resize", (event) => {
        setAspectRatio();
        setElementsSize();
        setElementsPosition();
	}, false);

    const debouncedLeftClick = debounce(onDebouncedLeftClick, 8); // ~120fps
    document.addEventListener('contextmenu', debouncedLeftClick);

    document.addEventListener("contextmenu", (event) => {
		event.preventDefault();
        HAS_GAME_STARTED = true;
	}, false);

    for (let i = 0; i < enemies.length; i++) {
        enemies[i].ELEMENT.addEventListener("mouseover", (event) => {
            setTargeting(true, enemies[i].id);
        });
        enemies[i].ELEMENT.addEventListener("mouseleave", (event) => {
            setTargeting(false, -1);
        });
    }

    document.addEventListener('keydown', (event) => {
        const key = event.key;
        switch (key) {
            case 's':
                player.isMovingFreely = false;
                player.isMovingInGrid = false;
                break;
            case 'S':
                player.isMovingFreely = false;
                player.isMovingInGrid = false;
                break;
            case 'e':
                player.moveSpeed = dashspeed;
                player.isDashing = true;
                break;
            case 'E':
                player.moveSpeed = dashspeed;
                player.isDashing = true;
                break;
            default:
                break;
        }
    });

    document.addEventListener('keyup', (event) => {
        const key = event.key;
        switch (key) {
            case 'e':
                player.moveSpeed = baseMoveSpeed;
                player.isDashing = false;
                break;
            case 'E':
                player.moveSpeed = baseMoveSpeed;
                player.isDashing = false;
                break;
            default:
                break;
        }
    });
}

function setTargeting(value, targetID){

    player.isTargeting = value;

    if(value){
        document.body.style.cursor = "url('assets/attackCursor.png'), auto";
        player.targetID = targetID;
    }
    else{
        document.body.style.cursor = "url('assets/cursor.png'), auto";
    }
}

function setElementsSize(){
	player.ELEMENT.style.width = player.width + "%";
	player.ELEMENT.style.height = player.height + "%";
    player.HALF_OFFSET_WIDTH = player.ELEMENT.offsetWidth / 2;

    for (let i = 0; i < enemies.length; i++) {
        enemies[i].ELEMENT.style.width = enemies[i].width + "%";
        enemies[i].ELEMENT.style.height = enemies[i].height + "%";
        enemies[i].HALF_OFFSET_WIDTH = enemies[i].ELEMENT.offsetWidth / 2;
    }
    
    CSS_ROOT.style.setProperty("--anim-sprite-height" , -((player.SPRITE_ELEMENT.offsetWidth / 64) * 768) + "px")
}

// TO-DO SET X Y OFFSETS AND SCALE RATIO, CALL ON RESIZE
function setElementsPosition(){

    if(!HAS_GAME_STARTED){
        //////////////////// TO DO //////////////////////    
    }

    player.position.x = (player.position.x) * RESIZED_SCALE_RATIO;
    player.position.y = (player.position.y) * RESIZED_SCALE_RATIO;

    player.ELEMENT.style.left = `${player.position.x - player.HALF_OFFSET_WIDTH}px`;
    player.ELEMENT.style.top = `${player.position.y - player.HALF_OFFSET_WIDTH}px`;

    player.movementPath = player.movementPath.map(element => {
        return {
            x: element.x * RESIZED_SCALE_RATIO,
            y: element.y * RESIZED_SCALE_RATIO
    }});

    player.target.x *= RESIZED_SCALE_RATIO;
    player.target.y *= RESIZED_SCALE_RATIO;

    for (let i = 0; i < enemies.length; i++) {

        enemies[i].position.x = (enemies[i].position.x) * RESIZED_SCALE_RATIO;
        enemies[i].position.y = (enemies[i].position.y) * RESIZED_SCALE_RATIO;
    
        enemies[i].ELEMENT.style.left = `${enemies[i].position.x - enemies[i].HALF_OFFSET_WIDTH}px`;
        enemies[i].ELEMENT.style.top = `${enemies[i].position.y - enemies[i].HALF_OFFSET_WIDTH}px`;
    
        enemies[i].movementPath = enemies[i].movementPath.map(element => {
            return {
                x: element.x * RESIZED_SCALE_RATIO,
                y: element.y * RESIZED_SCALE_RATIO
        }});
    
        enemies[i].target.x *= RESIZED_SCALE_RATIO;
        enemies[i].target.y *= RESIZED_SCALE_RATIO;
    }
}

function debounce(func, wait) {
    let timeout;
    return function (...args) {
        clearTimeout(timeout);
        timeout = setTimeout(() => func.apply(this, args), wait);
    };
}

function getDistance(x1, y1, x2, y2) {
    const dx = x2 - x1;
    const dy = y2 - y1;
    return Math.sqrt(dx * dx + dy * dy);
}

// return true if the clicked area is neighbour of the area the player is in
function isNeighbour(area, transform){
    let currentArea = getClickedArea(transform.position.x, transform.position.y);
    switch (area) {
        case "A0": return neighbourhoods[0].has(currentArea);
        case "A1": return neighbourhoods[1].has(currentArea);
        case "A2": return neighbourhoods[2].has(currentArea);
        case "A3": return neighbourhoods[3].has(currentArea);
        case "A4": return neighbourhoods[4].has(currentArea);
        case "A5": return neighbourhoods[5].has(currentArea);
        case "A6": return neighbourhoods[6].has(currentArea);
        case "A7": return neighbourhoods[7].has(currentArea);
        case "A8": return neighbourhoods[8].has(currentArea);
        case "A9": return neighbourhoods[9].has(currentArea);
        case "A10": return neighbourhoods[10].has(currentArea);
        case "A11": return neighbourhoods[11].has(currentArea);
        case "A12": return neighbourhoods[12].has(currentArea);
        default:
            return false;
    }
}

function getClickedArea(x, y){
    for (const area of areas) {
        if (x >= area.x1 && x <= area.x2 && y >= area.y1 && y <= area.y2) {
            return area.name;
        }
    }
    return "Outside";
}

function onDebouncedLeftClick(event){
    CLICKED_AREA = getClickedArea(event.clientX - X_OFSSET, event.clientY - Y_OFSSET)
    playClickAnimation(event.clientX, event.clientY);
    createPlayerPath(event.clientX - X_OFSSET, event.clientY - Y_OFSSET);
}

let lastCallTime = 0;
const delay = 500; 

function createPlayerPath(x, y){
    if(CLICKED_AREA === "Outside") return;

    if(player.isTargeting && (getDistance(player.position.x, player.position.y, enemies[player.targetID].position.x, enemies[player.targetID].position.y) <= player.attackRange)) {
        player.target.x = player.position.x;
        player.target.y = player.position.y;

        if(player.canDamage){
            const currentTime = Date.now();

            if (currentTime - lastCallTime < delay) {
                console.log("You must wait before calling this function again.");
                return;
            }
        
            // Update the last call time
            lastCallTime = currentTime;
            
            prepareProjectile();
            requestAnimationFrame(() => shotAt(player.targetID));
        }
        return;
    }

    player.target.x = x;
    player.target.y = y;
    
    updatePlayerDirection(player.target.x, player.target.y);
    updatePlayerSprite("running");

    if(!isNeighbour(CLICKED_AREA, player)){
        let startX = Math.round(player.position.x / SCALE_RATIO);
        let startY = Math.round(player.position.y / SCALE_RATIO);
        let endX = Math.round(player.target.x / SCALE_RATIO);
        let endY = Math.round(player.target.y / SCALE_RATIO);

        //console.log("Start:", startX, startY, "Goal:", endX, endY);
        if(enviromentMap[startX][startY] === 0){
            let newCoord = traverseNeighbors(enviromentMap, startX, startY, 5);
            startX = newCoord.x;
            startY = newCoord.y;
        }
        
        if(enviromentMap[startX][startY] === 0 || enviromentMap[endX][endY] === 0) return;
        
        let start = enviromentGraph.grid[startX][startY];
        let end = enviromentGraph.grid[endX][endY];

        let outputPath = astar.search(enviromentGraph, start, end);

        if(outputPath.length > 0){

            // player.movementPath = [];
            player.movementPath = outputPath.map(element => {
                return {
                    x: element.x * SCALE_RATIO,
                    y: element.y * SCALE_RATIO
            }});

            player.movementPath.unshift(); // not sure if needed
            player.movementPath.push({x: player.target.x, y: player.target.y});
        }
    }

    if(isNeighbour(CLICKED_AREA, player)){
        if (!player.isMovingFreely) {
            player.isMovingFreely = true;
            player.isMovingInGrid = false;
            requestAnimationFrame(movePlayerFreely);
        }
    }
    else {
        if (!player.isMovingInGrid) {
            player.isMovingFreely = false;
            player.isMovingInGrid = true;
            requestAnimationFrame(movePlayerInGrid);
        }
    }
}


function traverseNeighbors(matrix, row, col, depth = 2) {
    for (let dRow = -depth; dRow <= depth; dRow++) {
        for (let dCol = -depth; dCol <= depth; dCol++) {
            // Skip the center cell itself
            if (dRow === 0 && dCol === 0) continue;

            const newRow = row + dRow;
            const newCol = col + dCol;

            // Check matrix boundaries
            if (newRow >= 0 && newRow < matrix.length && newCol >= 0 && newCol < matrix[0].length) {
                if(matrix[newRow][newCol] === 1) return {x:newRow, y:newCol}
            }
        }
    }
    return {x:row, y:col};
}

function createEnemyPath(id){
    if(!HAS_GAME_STARTED) return;

    // updatePlayerDirection(player.target.x, player.target.y);
    // updatePlayerSprite("running");

    let startX = Math.round(enemies[id].position.x / SCALE_RATIO);
    let startY = Math.round(enemies[id].position.y / SCALE_RATIO);
    let endX = Math.round(player.position.x / SCALE_RATIO);
    let endY = Math.round(player.position.y / SCALE_RATIO);

    if(enviromentMap[startX][startY] === 0){
        let newCoord = traverseNeighbors(enviromentMap, startX, startY, 5);
        startX = newCoord.x;
        startY = newCoord.y;
    }
    
    if(enviromentMap[startX][startY] === 0 || enviromentMap[endX][endY] === 0) return;

    let start = enviromentGraph.grid[startX][startY];
    let end = enviromentGraph.grid[endX][endY];

    let outputPath = astar.search(enviromentGraph, start, end);

    if(outputPath.length > 0){
        enemies[id].movementPath = outputPath.map(element => {
            return {
                x: element.x * SCALE_RATIO,
                y: element.y * SCALE_RATIO
        }});

        enemies[id].movementPath.unshift(); // not sure if needed
        enemies[id].movementPath.push({x: enemies[id].target.x, y: enemies[id].target.y});
    }
    if (!enemies[id].isMovingInGrid) {
        enemies[id].isMovingInGrid = true;
        requestAnimationFrame(() => moveEnemyInGrid(id));
    }
}

function playClickAnimation(x, y) {

    if(player.isTargeting || CLICKED_AREA === "Outside") return;
    
    const CLICK_ANIMATION = document.createElement('div');

    if(!player.isTargeting)
        CLICK_ANIMATION.classList.add('clickAnimation');

    CLICK_ANIMATION.style.left = `${x - 10}px`; // Center the element
    CLICK_ANIMATION.style.top = `${y - 10}px`;

    document.body.appendChild(CLICK_ANIMATION);

    CLICK_ANIMATION.addEventListener('animationend', function () {
        CLICK_ANIMATION.remove();
    });
}

function updatePlayerDirection(targetX, targetY){
    let angle;

    if(player.isTargeting){
        angle = Math.atan2(enemies[player.targetID].position.y - player.position.y, enemies[player.targetID].position.x - player.position.x);
    }
    else{
        angle = Math.atan2(targetY - player.position.y, targetX - player.position.x);
    }
    player.direction = getCirclePart(angle * (180 / Math.PI));
}

function getCirclePart(degrees) {
    degrees+=157.5;
    degrees = degrees % 360;
    if (degrees < 0) degrees += 360; // Handle negative angles
    const partSize = 45;
    const part = Math.floor(degrees / partSize);
    return part;
}

function updatePlayerSprite(status){
    switch (status) {
        case "idle":
            player.SPRITE_ELEMENT.removeAttribute("class");
            player.SPRITE_ELEMENT.classList.add("idle" + player.direction);
            break;
        case "running":
            player.SPRITE_ELEMENT.removeAttribute("class");
            player.SPRITE_ELEMENT.classList.add("running" + player.direction);
            break;
        default:
            break;
    }
}

function damageEnemy(enemyID){
    enemies[enemyID].health -= 10;
    enemies[enemyID].HEALTH_ELEMENT.innerHTML = enemies[enemyID].health;
    projectile.ELEMENT.style.opacity = "0";

    if(enemies[enemyID].health === 0){
        // Reset enemy func maybe
        enemies[enemyID].position = enemiesSpawnPoints[enemyID];
        enemies[enemyID].health = 100;
        enemies[enemyID].HEALTH_ELEMENT.innerHTML = 100;
    }
    player.canDamage = true;
}

function movePlayerFreely(){
    if (!player.isMovingFreely) return;

    const distance = getDistance(player.position.x, player.position.y, player.target.x, player.target.y);

    if (distance < SCALE_RATIO * 5) {
        player.isMovingFreely = false;
        updatePlayerSprite("idle");
        return;
    }

    const angle = Math.atan2(player.target.y - player.position.y, player.target.x - player.position.x);

    const deltaX = Math.cos(angle) * (player.moveSpeed / 120 * SCALE_RATIO); // Divide by 120 for ~60fps
    const deltaY = Math.sin(angle) * (player.moveSpeed / 120 * SCALE_RATIO);

    player.position.x += deltaX;
    player.position.y += deltaY;

    player.ELEMENT.style.left = `${player.position.x - player.HALF_OFFSET_WIDTH}px`;
    player.ELEMENT.style.top = `${player.position.y - player.HALF_OFFSET_WIDTH}px`;

    // enemy.target.x = player.position.x;
    // enemy.target.y = player.position.y;

    requestAnimationFrame(movePlayerFreely);
}

function movePlayerInGrid() {
    if (!player.isMovingInGrid) return;

    player.target.x = player.movementPath[0].x;
    player.target.y = player.movementPath[0].y;

    player.movementPath.shift();

    if(player.movementPath.length === 1){
        player.isMovingInGrid = false;
        updatePlayerSprite("idle");
        return;
    }

    if(player.movementPath.length > 2){
        updatePlayerDirection(player.movementPath[1].x, player.movementPath[1].y);
    }

    player.position.x += (player.movementPath[0].x - player.target.x);
    player.position.y += (player.movementPath[0].y - player.target.y);

    player.ELEMENT.style.left = `${player.position.x - player.HALF_OFFSET_WIDTH}px`;
    player.ELEMENT.style.top = `${player.position.y - player.HALF_OFFSET_WIDTH}px`;

    // enemy.target.x = player.position.x;
    // enemy.target.y = player.position.y;

    requestAnimationFrame(movePlayerInGrid);
}

function moveEnemyInGrid(id) {
    if (!enemies[id].isMovingInGrid) return;

    enemies[id].target.x = enemies[id].movementPath[0].x;
    enemies[id].target.y = enemies[id].movementPath[0].y;

    enemies[id].movementPath.shift();

    if(enemies[id].movementPath.length === 1){
        enemies[id].isMovingInGrid = false;
        // updatePlayerSprite("idle");
        return;
    }

    // if(player.movementPath.length > 20){
    //     updatePlayerDirection(player.movementPath[19].x, player.movementPath[19].y);
    // }

    enemies[id].position.x += (enemies[id].movementPath[0].x - enemies[id].target.x);
    enemies[id].position.y += (enemies[id].movementPath[0].y - enemies[id].target.y);

    enemies[id].ELEMENT.style.left = `${enemies[id].position.x - enemies[id].HALF_OFFSET_WIDTH}px`;
    enemies[id].ELEMENT.style.top = `${enemies[id].position.y - enemies[id].HALF_OFFSET_WIDTH}px`;

    setTimeout(() => {
        requestAnimationFrame(() => moveEnemyInGrid(id));
    }, 50);
}

function prepareProjectile(){
    projectile.position.x = player.position.x;
    projectile.position.y = player.position.y;
    projectile.ELEMENT.style.opacity = "1";
}

function shotAt(enemyID){
    
    projectile.target.x = enemies[enemyID].position.x;
    projectile.target.y = enemies[enemyID].position.y;

    const distance = getDistance(projectile.target.x, projectile.target.y, projectile.position.x, projectile.position.y);

    if (distance < 40) {
        damageEnemy(enemyID);
        return;
    }
    const angle = Math.atan2(projectile.target.y - projectile.position.y, projectile.target.x - projectile.position.x);

    const deltaX = Math.cos(angle) * (projectile.moveSpeed / 120); 
    const deltaY = Math.sin(angle) * (projectile.moveSpeed / 120);

    // Update the current position
    projectile.position.x += deltaX;
    projectile.position.y += deltaY;

    projectile.ELEMENT.style.left = `${projectile.position.x}px`;
    projectile.ELEMENT.style.top = `${projectile.position.y}px`;
    projectile.ELEMENT.style.transform = `rotate(${angle * (180 / Math.PI)}deg)`;

    player.canDamage = false;
    requestAnimationFrame(() => shotAt(enemyID));
}

function setAspectRatio(){
	ASPECT_RATIO = 1920/1080;

    let arena = document.getElementById('arena');
    var height = window.innerHeight;
    var width = height * ASPECT_RATIO;

    if(width < window.innerWidth){
      arena.style.height = height + "px";
      arena.style.width = width + "px";
    }
    else {
      width = window.innerWidth;
      height = width * (1/ASPECT_RATIO);

      arena.style.height = height + "px";
      arena.style.width = width + "px";
    }
    
    let currScaleRatio = SCALE_RATIO;
    SCALE_RATIO = arena.offsetHeight / enviromentGraph.grid[0].length;
    RESIZED_SCALE_RATIO = HAS_GAME_STARTED ? SCALE_RATIO / currScaleRatio : 1;
    SCALE_RATIO_AREAS = arena.offsetHeight / 1080; 

    X_OFSSET =  (window.innerWidth - arena.offsetWidth)  / 2;
    Y_OFSSET =  (window.innerHeight - arena.offsetHeight)  / 2;
    
    // console.log(SCALE_RATIO, X_OFSSET, Y_OFSSET);

    arena.style.top = (window.innerHeight - height)/2 + "px";
    arena.style.left = (window.innerWidth - width)/2 + "px";

    areas = [
        { name: "A0", x1: 0, y1: 0, x2: 240 * SCALE_RATIO_AREAS, y2: 240  * SCALE_RATIO_AREAS},
        { name: "A1", x1: 240 * SCALE_RATIO_AREAS, y1: 0, x2: 480 * SCALE_RATIO_AREAS, y2: 240  * SCALE_RATIO_AREAS},
        { name: "A2", x1: 480 * SCALE_RATIO_AREAS, y1: 0, x2: 1440 * SCALE_RATIO_AREAS, y2: 240  * SCALE_RATIO_AREAS},
        { name: "A3", x1: 1440 * SCALE_RATIO_AREAS, y1: 0, x2: 1680 * SCALE_RATIO_AREAS, y2: 240  * SCALE_RATIO_AREAS},
        { name: "A4", x1: 1680 * SCALE_RATIO_AREAS, y1: 0, x2: 1920 * SCALE_RATIO_AREAS, y2: 240  * SCALE_RATIO_AREAS},
    
        { name: "A5", x1: 0, y1: 240 * SCALE_RATIO_AREAS, x2: 240 * SCALE_RATIO_AREAS, y2: 840 * SCALE_RATIO_AREAS},
        { name: "A6", x1: 480 * SCALE_RATIO_AREAS, y1: 240 * SCALE_RATIO_AREAS, x2: 1440 * SCALE_RATIO_AREAS, y2: 840 * SCALE_RATIO_AREAS},
        { name: "A7", x1: 1680 * SCALE_RATIO_AREAS, y1: 240 * SCALE_RATIO_AREAS, x2: 1920 * SCALE_RATIO_AREAS, y2: 840 * SCALE_RATIO_AREAS},
    
        { name: "A8", x1: 0, y1: 840 * SCALE_RATIO_AREAS, x2: 240 * SCALE_RATIO_AREAS, y2: 1080 * SCALE_RATIO_AREAS},
        { name: "A9", x1: 240 * SCALE_RATIO_AREAS, y1: 840 * SCALE_RATIO_AREAS, x2: 480 * SCALE_RATIO_AREAS, y2: 1080 * SCALE_RATIO_AREAS},
        { name: "A10", x1: 480 * SCALE_RATIO_AREAS, y1: 840 * SCALE_RATIO_AREAS, x2: 1440 * SCALE_RATIO_AREAS, y2: 1080 * SCALE_RATIO_AREAS},
        { name: "A11", x1: 1440 * SCALE_RATIO_AREAS, y1: 840 * SCALE_RATIO_AREAS, x2: 1680 * SCALE_RATIO_AREAS, y2: 1080 * SCALE_RATIO_AREAS},
        { name: "A12", x1: 1680 * SCALE_RATIO_AREAS, y1: 840 * SCALE_RATIO_AREAS, x2: 1920 * SCALE_RATIO_AREAS, y2: 1080 * SCALE_RATIO_AREAS},
    ];
}